import React,{useContext,useState} from 'react'
import { DepositState } from '../App'
import './DepositModal.css'
import { AppState } from '../App'
import './DepositModal.css'

const DepositModal = ({openmodal}) => {


    const {amountDeposit} = useContext(DepositState)  
    const {userInfo} = useContext(AppState)

    const [show,setShow] = useState(false)


  return (

    <div className='depositModal'>
        {show && <DepositModal/>}
         <div className='modal__content'>
             {<h2>{userInfo.Fname}You have  deposited {amountDeposit.deposit}</h2>}
             <div>
                  <button className='button' onClick={()=>{
                        setShow(false)
                  }}>Ok</button>
             </div>
         </div>

    </div>
  )
}

export default DepositModal
